import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Startups = () => {
  const [startups, setStartups] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchStartups();
  }, []);

  const fetchStartups = async () => {
    try {
      const response = await axios.get('http://localhost:8000/api/startups/');
      setStartups(response.data.results || []);
    } catch (error) {
      console.error('Error fetching startups:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="animate-spin rounded-full h-16 w-16 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900">Startups</h1>
          <p className="mt-2 text-gray-600">Discover innovative companies changing the world</p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {startups.map((startup) => (
            <div key={startup.id} className="bg-white rounded-xl shadow-sm p-6 hover:shadow-md transition-shadow">
              <div className="flex items-center space-x-3 mb-4">
                <div className="text-3xl">{startup.logo}</div>
                <div>
                  <h3 className="text-lg font-semibold text-gray-900">{startup.name}</h3>
                  <p className="text-sm text-gray-600">{startup.industry_name}</p>
                </div>
              </div>
              
              <p className="text-gray-700 text-sm mb-4 line-clamp-3">{startup.description}</p>
              
              <div className="flex items-center justify-between">
                <div className="flex items-center space-x-2">
                  <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-blue-100 text-blue-800">
                    {startup.location}
                  </span>
                  <span className="text-xs text-gray-500">{startup.employee_count} employees</span>
                </div>
                <div className="flex items-center space-x-2">
                  <span className="text-yellow-400">‚≠ê</span>
                  <span className="text-sm text-gray-600">{startup.average_rating || '0.0'}</span>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Startups;
